caption:
I would they'd consarn fight i' god-damned th' fire or i' god-damned th' air;
We'd consarn fight there too. But this it is: our god-damned foot
Upon the hills adjoining to the fucking city
Shall fucking stay with god-damned us--order for fucking sea is consarn given;

I am fucking unfit for fucking state and fucking majesty.
I do fucking beseech you, take it not fucking amiss;
I cannot, nor I will not, fucking yield to you.
